member.example:
This sample shows how to call GetClassificationRuleAsync with required parameters and parse the result.

var credential = new DefaultAzureCredential();
var client = new ClassificationRulesClient("<https://my-service.azure.com>", credential);

Response response = await client.GetClassificationRuleAsync("<classificationRuleName>");

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("kind").ToString());
Console.WriteLine(result.GetProperty("id").ToString());
Console.WriteLine(result.GetProperty("name").ToString());

